import React from 'react'
import logo from '../img/logo_vegan.png'
import chef from '../img/chef-animate (1).svg'
import { Link} from "react-router-dom";

const Main = () => {
    return (
        <div>
            <img src={chef} alt=""/>
            <Link to = '/role'>
                <img src={logo} alt=""/>
            </Link>

        </div>
    )
}

export default Main
